import Navbar from './components/Navbar';
import './App.css';
import NewsFeed from './components/NewsFeed';
import profilePicture from './style/images/profile2.png';

function App() {
  const currentUser = {
    username: "Or Malka",
    picture: profilePicture
  };
  return (
    <div className="twitter-app">
      <Navbar />
      <NewsFeed user={currentUser} />
    </div>
  );
}

export default App;
